export default {
  name: {
    marginVertical: 10,
    fontSize: 20,
    fontFamily: 'Georgia, serif'
  },
  button: (disabled) => {
    return {
      backgroundColor: disabled ? '#' : '#000000',
      width: 180,
      alignItems: 'center',
      padding: 10,
      borderRadius: 10
    }
  },
  textButton: {
    fontSize: 20,
    fontFamily: 'Georgia, serif',
    color: '#FFFFFF'
  },
  imageView: {
    alignItems: 'center',
    padding: 20
  },
  image: {
    height: 200,
    width: 180
  }
}
